      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE + - 25 + + col2 NOT IN ( - - col2 + + col0 * ( col2 ) * + col1 * col0 * + col2 + + + col2, + ( + col2 ) );
  - name: tab0

outputs:
  - name: q10542.out
    data: |
      15	81	47
      87	21	10
      97	1	99
